    <Layout>
      <main className="px-4 sm:px-8 py-12 max-w-5xl mx-auto min-h-[80vh] flex flex-col justify-center">
        <h2 className="text-3xl font-bold text-green-900 mb-4">Contact a Farmer</h2>
        <p className="text-lg text-gray-800 mb-6">
          Reach out directly to verified farmers for your paddy requirements. Fill out the form below to get started.
        </p>
        {/* You can add a contact form or farmer directory here later */}
      </main>
    </Layout>
  );
}
